		"id_str": "1205031442423504896",
		"full_text": "더구나 펭수는 2가지 점에서 특징적인데, ① 애초부터 타 컨텐츠에 비해 윤리적으로 상당히 높은 규준을 갖고 인기를 끌어모은 상황에서 ② 모 브랜드인 EBS와 아주 단단히 결착되어 있다는 점이다. 이 2가지는 앞으로도 EBS에 위기관리라는 새로운 도전을 안겨줄 것이라고 생각한다.",
