		"id_str": "1205031431753199616",
		"full_text": "영유아·청소년 소비자는 구매력은 약하지만 항의할 방법도 없고 이탈할 대체재도 없다는 점에서 상대적으로 ‘유순한’ 소비자다. 성인 소비자는 구매력도 월등하지만 항의/이탈 역시 매우 활발한 집단이다. 4시간 만에 펭수 책 2만부가 팔렸다는 얘기는 거꾸로 보면 압력으로 돌아올 수 있는 속도다.",
