		"text": "펭수의 인기가 EBS에 갖는 의미는 단순히 유튜브 구독자가 100만이 넘고 광고수입이 얼마고 하는 게 아니다. 진짜 본질적인 의미는 EBS의 고객집단이 재정의되고 있다는 것. 사실상 항의의 수단이 없거나, 대체재가 부족했던 영유아·청소년에 성인 시청자가 더해지는 일은 EBS에 새로운 도전이다."
