		"text": "차트, 어워즈 어뷰징에 대해서 잘못된 점에 대해 꾸준히 말해왔던 사람이다. 차트에 대해 공부하고 정리도 했었다. 그리고 돌덤 내에서 목격한 적도 있으며 주최사와 연락을 주고 받기도 했었다. \n\n다만 이 국민청원의 여러 층위가 퉁쳐져 있고 방향이 인터넷 규제로 향하는 것에 공감할 수 없다."
