		"text": "아이유│② 지은이 이지은의 시 다섯\nby 글 김겨울, 김소미, 임현경, 전연주, 강명석, 디자인 전유림\n\n아이유의 노래를 듣는다면 반드시 그의 가사가 떠오르는 순간이 있다. 인생의 한 시점에서 자신에게 깊은 기억을 남긴 아이유의 가사 다섯.\n\nhttps://t.co/mN6BmbzBt8\n\n#아이유 #Lovepoem https://t.co/FqEvBQPAnt"
