		"text": "‘Love poem’의 노래들은 곡마다 다른 목소리로 사랑에 대한 가사의 내용을 그대로 반영한다. 아직은 사랑에 대해 이야기하기 조심스러운 한 사람의 내면을 음악으로써 표현하고, 그런 사랑의 형태가 음악이 되는 것 역시 아티스트가 보여줄 수 있는 새로운 발자취다. 이것이야말로 ‘시적 허용’이다."
