		"lang": "ko",
		"text": "감정의 절제, 혹은 개인적인 감정의 추상화는 그 자체로 ‘Love poem’이 내세우는 ‘사랑시’의 형식이다. 앨범과 동명의 타이틀곡 ‘Love poem’에서 아이유의 목소리는 울리는 소리로 표현되며 상대를 위해 멀리서 노래하는 상태를 형상화하고, 기교를 최소화한 창법은 담담하게 가사를 전달한다."
